// Ruta al archivo HTML que contiene la estructura visual de este componente\n  templateUrl: './team.component.html',\n\n  // Ruta al archivo CSS que contiene los estilos específicos para este componente\n  styleUrl: './team.component.css'\n})\n\n// Definición de la clase TeamComponent que implementa el comportamiento del componente\nexport class TeamComponent {\n\n  // Aquí van los métodos y propiedades específicas del componente.\n  // Actualmente no tiene lógica implementada, pero es donde agregarías funcionalidad más tarde.\n\n}\n\n    \n\n    \n        \n  \n  NUESTRO EQUIPO\n  &nbsp;\n  &nbsp;\n\n  \n  \n      \n      \n          \n          \n          C.E.O\n          \n          El CEO de nuestra empresa es un líder visionario con una sólida trayectoria en la industria. Con más de 20 años de experiencia, ha demostrado un compromiso inquebrantable con la innovación y la excelencia operativa. Su enfoque estratégico ha sido fundamental para guiar a la empresa hacia el crecimiento sostenible y el éxito en un mercado en constante evolución.\n      \n\n      \n      \n          \n          \n          JEFE DE MARKETING\n          \n          El Jefe de Marketing de nuestra empresa es un profesional apasionado y creativo con una amplia experiencia en el desarrollo e implementación de estrategias de marketing efectivas. Con más de 20 años en la industria, ha demostrado su capacidad para impulsar el crecimiento de la marca y aumentar la visibilidad en un mercado competitivo.\n      \n\n      \n      \n          \n          \n          COMMUNIY MANAGER\n          \n          El Community Manager de nuestra empresa es un apasionado de la comunicación digital y la construcción de comunidades en línea. Con una sólida experiencia en gestión de redes sociales y marketing digital, ha dedicado más de 20 años a conectar marcas con sus audiencias de manera auténtica y efectiva.\n      \n  \n\n  \n  \n      \n      \n          \n          \n          GERENTE DE ALMACEN\n          \n          El Gerente de Almacén de nuestra empresa es un profesional altamente organizado y eficiente, con una sólida experiencia en la gestión de operaciones logísticas y de almacenamiento. Con más de 20 años en el sector, ha demostrado su capacidad para optimizar procesos y garantizar un flujo de trabajo fluido en el almacén.\n      \n\n      \n      \n          \n          \n          GERENTE FINANCIERO\n          \n          El Gerente Financiero de nuestra empresa es un profesional altamente calificado y analítico, con una amplia experiencia en la gestión de finanzas corporativas y planificación estratégica. Con más de 20 años en el sector, ha demostrado su capacidad para optimizar recursos y garantizar la salud financiera de la organización.\n      \n\n      \n      \n          \n          \n          CONSERJE\n          \n          El Conserje de nuestra empresa es un profesional dedicado y atento, responsable de mantener un ambiente limpio, seguro y acogedor para todos los empleados y visitantes. Con una sólida experiencia en el mantenimiento y la gestión de instalaciones, se asegura de que cada rincón de nuestras instalaciones refleje nuestros estándares de calidad y profesionalismo.\n      \n  \n\n\n    \n\n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = '    NUESTRO EQUIPO                                                    C.E.O                    El CEO de nuestra empresa es un líder visionario con una sólida trayectoria en la industria. Con más de 20 años de experiencia, ha demostrado un compromiso inquebrantable con la innovación y la excelencia operativa. Su enfoque estratégico ha sido fundamental para guiar a la empresa hacia el crecimiento sostenible y el éxito en un mercado en constante evolución.                                                JEFE DE MARKETING                    El Jefe de Marketing de nuestra empresa es un profesional apasionado y creativo con una amplia experiencia en el desarrollo e implementación de estrategias de marketing efectivas. Con más de 20 años en la industria, ha demostrado su capacidad para impulsar el crecimiento de la marca y aumentar la visibilidad en un mercado competitivo.                                                COMMUNIY MANAGER                    El Community Manager de nuestra empresa es un apasionado de la comunicación digital y la construcción de comunidades en línea. Con una sólida experiencia en gestión de redes sociales y marketing digital, ha dedicado más de 20 años a conectar marcas con sus audiencias de manera auténtica y efectiva.                                                      GERENTE DE ALMACEN                    El Gerente de Almacén de nuestra empresa es un profesional altamente organizado y eficiente, con una sólida experiencia en la gestión de operaciones logísticas y de almacenamiento. Con más de 20 años en el sector, ha demostrado su capacidad para optimizar procesos y garantizar un flujo de trabajo fluido en el almacén.                                                GERENTE FINANCIERO                    El Gerente Financiero de nuestra empresa es un profesional altamente calificado y analítico, con una amplia experiencia en la gestión de finanzas corporativas y planificación estratégica. Con más de 20 años en el sector, ha demostrado su capacidad para optimizar recursos y garantizar la salud financiera de la organización.                                                CONSERJE                    El Conserje de nuestra empresa es un profesional dedicado y atento, responsable de mantener un ambiente limpio, seguro y acogedor para todos los empleados y visitantes. Con una sólida experiencia en el mantenimiento y la gestión de instalaciones, se asegura de q